Each table manages the lifecycle of its records independently. Record State Machine : Record States within Table: ACTIVE â”€â”€deleteâ”€â”€â†’ DELETED â”€â”€expireâ”€â”€â†’ TOMBSTONE â†‘ â”‚ â”‚ â””â”€â”€â”€â”€â”€â”€resurrectâ”€â”€â”€â”˜ â”‚ â”‚ â†â”€â”€â”€â”€â”€â”€cleanupâ”€â”€â”€â”€â”€â”€â”˜ State Definitions : ACTIVE : Record is live and available for operations DELETED : Soft-deleted, still recoverable, counts toward table capacity TOMBSTONE : Marked for cleanup, space will be reclaimed Table-Level Operations : Insert Record : impl Table { fn insert(&mut self, data: &[u8]) -> Result<RecordId> { let slot = self.find_free_slot()?; let record_id = self.generate_snowflake_id(); // Write record to slot self.write_record(slot, record_id, data)?; self.mark_slot_used(slot); // Update primary index: record_id â†’ slot_position self.primary_index.insert(record_id, slot)?; // Update secondary indexes self.update_secondary_indexes(record_id, data)?; Ok(record_id) }
} Read Record : fn get(&self, record_id: RecordId) -> Option<&Record> { // Use primary index to find slot let slot = self.primary_index.get(record_id)?; let record = self.get_slot(slot)?; if record.is_active() { Some(record) } else { None }
